import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Ahmed Ali Farajallah</h1>
      <h3> I am Software Engineer</h3>
      <h5>I think it will be a good day</h5>
      <h1 style={'font-size: 30px'}>Ok, let's start</h1>
    </div>
  );
}

export default App;
